import React from "react";
import "./item.css";

const ItemList = () => {
   return (
      <div className="item_box">
         <div>
            <div style={{ fontWeight: 600 }}>Sushi</div>
            <span>finest fish and veggies</span>
            <div>$22.99</div>
         </div>
         <div>
            <div>
               <strong>Amount</strong>
               <input
                  className="me-2"
                  type="number"
                  min="0"
                  max="10"
                  style={{ width: 40 }}
                  value="0"
               />
            </div>
            <div>
               <button className="btn">+ Add</button>
            </div>
         </div>
      </div>
   );
};

export default ItemList;
